import React from 'react'
import Navbar from '../layouts/Navbar'
import { MDBContainer, MDBNavbar, MDBNavbarBrand, MDBNavbarItem, MDBTypography } from 'mdb-react-ui-kit'

export function CheckoutNoAcc() {
    return (
        <div>
            <Navbar />

            <div>
                {stickyFooter()}
            </div>
        </div>
    )
}

export function CheckoutWithAcc() {
    return (
        <div>
            <Navbar></Navbar>
            <div>

                {stickyFooter()}
            </div>
        </div>
    )
}

function stickyFooter() {
    return (
        <div light bgColor='light' className='shadow-4-strong fixed-bottom'>
            <MDBContainer fluid>
                <MDBNavbarItem className="justify-content-end">
                    <div className='mb-5'>
                        <MDBTypography className='mb-0 float-start'> Thành tiền</MDBTypography>
                        <MDBTypography className='mb-0 float-end'> 127.300 đ</MDBTypography>
                    </div>
                    <div className='mb-5'>
                        <MDBTypography className='float-start'>
                            Giảm giá (Nhập mã thành công - Mã giảm giá 10% - Đơn hàng từ 100K - Khi mua Sách Học Ngoại Ngữ)</MDBTypography>
                        <MDBTypography className='mb-0 float-end'> -10.000 đ</MDBTypography>
                    </div>
                    <div id='shipping-fee'>
                        <MDBTypography className='mb-0 float-start'> Phí vận chuyển (Giao hàng tiêu chuẩn)</MDBTypography>
                        <MDBTypography className='mb-0 float-end'> 18.000 đ</MDBTypography>
                    </div>
                </MDBNavbarItem>
            </MDBContainer>
        </div>
    )
}
